import {BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';


class App extends Component {





  render(){
    return (
      <div className="App">
        <Router>
        <Link path='./components/doodle.js'> Hallo </Link>

      </Router>
      </div>
